import React from "react";
import ContactMe from "../../pages/ContactMe";


function Footer() {
    return (
        <footer>
            <ContactMe/>
            <div>
                <h1>Contact Me</h1>
                <ul>
                    <li>By phone</li>
                    <li>By email</li>
                </ul>
            </div>
        </footer>
    )
};

export default Footer;
